import React from "react";
import "./Blogitem.css"
export default function Blogitem(props) {
    const { blogs } = props;
    return (
        <>
            <div className="col md-3">
                <div class="card my-3">
                    <div class="card-body">
                        <h5 class="card-title">{blogs.title}</h5>
                        <p class="card-text">{blogs.description}</p>
                        <p className="card-text">{blogs.tag}</p>

                    </div>
                </div>
            </div>
        </>
    )
}
